<!DOCTYPE html>
<html lang="en">

<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <meta http-equiv="X-UA-Compatible"="ie=edge">
  <title>洛达科技云电脑</title>
  <style>
    body {
body {
      font-family: Arial, sans-serif;
      background: url('https://api.imlazy.ink/img') no-repeat center center fixed;
      background-size: cover;
      height: 100vh;
    }

    /* 调整整体容器样式，使其在手机端更好地自适应布局 */
  .container {
      display: flex;
      justify-content: center;
      align-items: center;
      flex-direction: column; /* 改为列布局，方便手机端显示 */
      height: 100%;
      padding: 10px; /* 添加内边距，避免内容紧贴屏幕边缘 */
    }

    /* 调整表单样式，使其在手机端宽度更合适 */
  .form {
      width: 100%; /* 占满手机屏幕宽度 */
      max-width: none; /* 去除之前的最大宽度限制 */
      background: #fff;
      padding: 20px;
      border-radius: 10px;
      box-shadow: 0 0 10px rgba(0, 0, 0, 0.2);
    }

    button {
      display: block;
      width: 100%;
      padding: 10px;
      background-color: #007bff;
      color: #fff;
      border: none;
      border-radius: 5px;
      font-size: 16px;
      cursor: pointer;
      transition: background-color 0.3s ease;
    }

    h1 {
      text-align: center;
      color: #333;
    }

    label {
      display: block;
      margin-bottom: 10px;
      color: #333;
      font-weight: bold;
    }

    input[type="text"],
    input[type="password"],
    select {
      width: 100%;
      padding: 10px;
      border: 1px solid #ccc;
      border-radius: 5px;
      margin-bottom: 20px;
      box-sizing: border-box;
    }

    input[type="submit"] {
      display: block;
      margin: 0 auto;
      background: linear-gradient(to bottom, #333, #222);
      color: #fff;
      border: none;
      padding: 10px 20px;
      border-radius: 5px;
      cursor: pointer;
    }

    input[type="submit"]:hover {
      background: linear-gradient(to bottom, #555, #444);
    }

    p {
      text-align: center;
      color: #666;
    }

    #result {
      color: red;
    }

    #myMenu {
      position: absolute;
      background: #eee;
      list-style: none;
      visibility: hidden;
    }

    #open-account {
      width: 100%; /* 占满手机屏幕宽度 */
      max-width: none; /* 去除之前的最大宽度限制 */
      background: #fff;
      padding: 20px;
      border-radius: 10px;
      box-shadow: 0 0 10px rgba(0, 0, 0, 0.2);
    }

    #open-account h2 {
      text-align: center;
      color: #333;
      margin-bottom: 20px;
    }

    #open-account label {
      display: block;
      margin-bottom: 10px;
      color: #333;
      font-weight: bold;
    }

    #captcha-img {
      max-width: 50%;
      height: auto;
      display: block;
      margin: 0 auto;
    }

    #open-account input[type="text"],
    #open-account input[type="password"],
    #open-account select {
      width: 100%;
      padding: 10px;
      border: 1px solid #ccc;
      border-radius: 5px;
      margin-bottom: 20px;
      box-sizing: border-box;
    }

    /* 调整滑块验证码容器样式，使其在手机端更适配 */
  .drag {
      width: 100%; /* 占满手机屏幕宽度 */
      max-width: 300px; /* 限制最大宽度，避免在大屏幕手机上过于宽 */
      height: 40px;
      line-height: 40px;
      background-color: #e8e8e8;
      position: relative;
      margin: 0 auto;
    }

    /* 调整滑块按钮样式，使其在手机端触摸操作更友好 */
  .btn {
      width: 40px;
      height: 38px;
      position: absolute;
      border: 1px solid #ccc;
      cursor: pointer; /* 改为cursor: pointer，更适合触摸操作 */
      font-family: "宋体";
      text-align: center;
      background-color: #fff;
      user-select: none;
      color: #666;
    }

    @media (min-width: 768px) {
      /* 在平板及以上设备，恢复一些样式为原来的布局样式 */
    .container {
        flex-direction: row;
      }

    .form {
        width: 90%;
        max-width: 400px;
      }

    .open-account {
        width: 90%;
        max-width: 600px;
      }

    .drag {
        width: 300px;
      }
    }

    /* 弹窗样式 */
  .modal {
      display: none;
      /* 默认隐藏 */
      position: fixed;
      /* 固定定位 */
      z-index: 1;
      /* 层级在最上层 */
      left: 0;
      top: 0;
      width: 100%;
      height: 100%;
      overflow: auto;
      /* 如果内容过多出现滚动条 */
      background-color: rgba(0, 0, 0, 0.4);
      /* 半透明背景 */
    }

  .modal-content {
      background-color: #fefefe;
      margin: 15% auto;
      /* 上下居中 */
      padding: 20px;
      border: 1px solid #888;
      width: 80%;
    }

  .close {
      color: #aaa;
      float: right;
      font-size: 28px;
      font-weight: bold;
    }

  .close:hover,
  .close:focus {
      color: black;
      text-decoration: none;
      cursor: pointer;
    }
  </style>
  <style type="text/css">
    * {
      user-select: auto!important;
      -webkit-user-select: auto!important;
    }
  </style>
